import React from 'react';
import Stats from '../components/Stats';
import CountrySelector from '../components/CountrySelector';
import { createGlobalStyle } from 'styled-components';
import Head from 'next/head';

const GlobalStyle = createGlobalStyle`
*{
  margin:0;
  padding:0;
  box-sizing:border-box;
}

html {
font-family:--apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
}
`;

export default function IndexPage() {
  let date = new Date();
  let dateNow = date.getFullYear();
  return (
    <div>
      <Head>
        <title>КОРОНА ВИРУС - COVID 19 статистика</title>
        <meta
          property="og:title"
          content="КОРОНА ВИРУС - COVID 19 статистика"
          key="title"
          description="статистика о корона вирусу COVID 19"
        />
      </Head>
      <GlobalStyle />
      <CountrySelector />
      <Stats url="https://covid19.mathdro.id/api" />
      <footer>
        Copyright &copy; <span>{dateNow}</span>, Stefan Ljiljak
      </footer>
    </div>
  );
}
